      .then((response) => response.json())
      .then((data) => console.log(data));
  }

  useEffect(() => {
    loadRecipe();
  });

  return (
    <div>
      <h1>hey</h1>
      <button onClick={loadRecipe()}>Update</button>
    </div>
  );
}

export default App;
